  station_id_ger = EXCLUDED.station_id_ger,
  name = EXCLUDED.name,
  city = EXCLUDED.city,
  country = EXCLUDED.country,
  category = EXCLUDED.category,
  price_category = EXCLUDED.price_category,
  has_wifi = EXCLUDED.has_wifi,
  wifi_notes = EXCLUDED.wifi_notes,
  has_toilets = EXCLUDED.has_toilets,
  toilet_notes = EXCLUDED.toilet_notes,
  is_open_24h = EXCLUDED.is_open_24h,
  opening_hours = EXCLUDED.opening_hours,
  latitude = EXCLUDED.latitude,
  longitude = EXCLUDED.longitude,
  additional_info = EXCLUDED.additional_info;

-- Create standard B-tree indexes
CREATE INDEX IF NOT EXISTS category_idx ON stations(category);
CREATE INDEX IF NOT EXISTS category_name_idx ON stations(category, name);
CREATE INDEX IF NOT EXISTS name_idx ON stations(name);
CREATE INDEX IF NOT EXISTS city_idx ON stations(city);
CREATE INDEX IF NOT EXISTS country_idx ON stations(country);
CREATE INDEX IF NOT EXISTS open_24h_idx ON stations(is_open_24h);
CREATE INDEX IF NOT EXISTS warm_sleep_idx ON stations(has_warm_sleep);
CREATE INDEX IF NOT EXISTS toilets_idx ON stations(has_toilets);
CREATE INDEX IF NOT EXISTS toilets_at_night_idx ON stations(toilets_open_at_night);
CREATE INDEX IF NOT EXISTS outlets_idx ON stations(has_outlets);
CREATE INDEX IF NOT EXISTS wifi_idx ON stations(has_wifi);

-- Create trigram indexes for fuzzy search (requires pg_trgm extension)
CREATE INDEX IF NOT EXISTS stations_name_trgm_idx ON stations USING GIN (name gin_trgm_ops);
CREATE INDEX IF NOT EXISTS stations_city_trgm_idx ON stations USING GIN (city gin_trgm_ops);
CREATE INDEX IF NOT EXISTS stations_name_similarity_idx ON stations USING GIST (name gist_trgm_ops);
CREATE INDEX IF NOT EXISTS stations_city_similarity_idx ON stations USING GIST (city gist_trgm_ops);

